var FRAME = 'data:image/jpg;base64,';

const leftControllerSubject = new rxjs.Subject();
const rightControllerSubject = new rxjs.Subject();

function adjustSensibility([x, y]) {
  let returnedX = x;
  let returnedY = -y;
  const sensibility = 0.15;

  if (returnedX > 0 && returnedX < sensibility) {
    returnedX = 0;
  } else if (returnedX < 0 && returnedX > -sensibility) {
    returnedX = 0;
  }

  if (returnedY > 0 && returnedY < sensibility) {
    returnedY = 0;
  } else if (returnedY < 0 && returnedY > -sensibility) {
    returnedY = 0;
  }

  returnedX = (returnedX * 100);
  returnedY = (returnedY * 100);

  return [Math.round(returnedX), Math.round(returnedY)];
}

rxjs.combineLatest(
  leftControllerSubject.pipe(rxjs.operators.startWith(null)),
  rightControllerSubject.pipe(rxjs.operators.startWith(null))
)
.pipe(
  //rxjs.operators.debounceTime(1000),
  rxjs.operators.map(([left, right]) => {
    let returnedLeft = [0 , 0];
    let returnedRight = [0, 0];
    if (left) {
      returnedLeft = adjustSensibility(left.detail.axis);
    }

    if (right) {
      returnedRight = adjustSensibility(right.detail.axis);
    }

    return [returnedLeft, returnedRight];
  })
)
.subscribe(([left, right]) => {
  if (FlightControl.ws) {
    FlightControl.axismove(left, right);
  }
});

const WS_URL = 'ws://10.8.1.137:3001';
const ws = new WebSocket(WS_URL);
var lastFrame;

ws.onopen = () => console.log(`Connected to ${WS_URL}`);

ws.onmessage = (message) => {
  lastFrame = message.data;
};

FlightControl.ws = ws;

var el;
var leftHand;
var rightHand;

AFRAME.registerComponent('vr-controls', {
  init: function () {
    var el = this.el;
    el.addEventListener('xbuttondown', function (evt) {
      FlightControl.x();
    });

    el.addEventListener('ybuttondown', function (evt) {
      FlightControl.y();
    });

    el.addEventListener('axismove', function (evt) {
      // console.log('meeee', evt);
      if (evt.target.getAttribute('id') === 'left-control') {
        leftControllerSubject.next(evt);
      } else {
        rightControllerSubject.next(evt);
      }
    });
  }
});

const mainLoop = function() {
  if (lastFrame) {
    el.setAttribute('material', 'src', lastFrame);
    el.setAttribute('material', '', );
    lastFrame = null;
  }

  //console.log(leftHand.getAttribute('position'));

  requestAnimationFrame(mainLoop);
};

document.addEventListener('DOMContentLoaded', () => {
  el = document.querySelector('#entity1');
  leftHand = document.querySelector('#left-control');
  rightHand = document.querySelector('#right-control');
  const width = 1; // meters
  const height = width * 760 / 960;

  el.setAttribute('width', width);
  el.setAttribute('height', height);
  mainLoop();
});
